// Shared
import Error401 from './../views/shared/Error401';
import Error404 from './../views/shared/Error404';

// Layouts

const sharedRoute = [
	// Error 401 Unauthorized
	{
		path: '/error-401',
		title: 'Không có quyền',
		icon: 'design_app',
		roles: null,
		component: Error401,
		layout: ({ children }) => <>{children}</>,
		wrapContextProvider: null,
	},
	// Error 404 Not Found
	{
		path: '/error-404',
		title: 'Không tìm thấy',
		icon: 'design_app',
		roles: null,
		component: Error404,
		layout: ({ children }) => <>{children}</>,
		wrapContextProvider: null,
	},
];

export default sharedRoute;
